sys_variable_value.value:
(function execute(inputs, outputs) {
    var propArr = [];
    var brQry = 'scriptLIKE' + inputs.prop + '^ORfilter_conditionLIKE' + inputs.prop + '^ORconditionLIKE' + inputs.prop;
    var brTbl = new GlideRecord('sys_script');
    brTbl.addEncodedQuery(brQry);
    brTbl.query();
    while (brTbl.next()) {
        propArr.push(brTbl.getValue('name'));
    }

    propArr.length > 0 ? outputs.br_array = propArr : outputs.br_array = "Not Found";
})(inputs, outputs);

